import './App.css';
import Card from './components/Card';
import MyBtn from './components/MyBtn';
import BoardInsertPage from './pages/board/BoardInsertPage';
import HomePage from './pages/HomePage';

function App() {
  const arr = ['하나', '둘', '셋'];
  return (
    <>
      <MyBtn x="하나" />
      <MyBtn x="둘" />
      <MyBtn x="셋" />
      <Card a="♥" b="3" />
      <Card a="♣" b="5" />
      <Card a="♠" b="7" />
      <Card a="♦" b="9" />
    </>
  );
}

export default App;
